const _ = require('lodash');
const validateSaleSettings = ({
  name,
  params,
  sellSettings
}) => {
  if (name == null) {
    throw new Error(`name is required`);
  }

  // params
  if (params.collectionName == null) {
    throw new Error(`${name}: params.collectionName is required`);
  }
  if (params.schemaName == null) {
    throw new Error(`${name}: params.schemaName is required`);
  }

  // sale settings
  if (sellSettings.maxPrice == null) {
    throw new Error(`${name}: maxPrice is required`);
  }
  if (sellSettings.minPrice == null) {
    throw new Error(`${name}: minPrice is required`);
  }
  if (sellSettings.allowedDiscountPriceRate == null) {
    throw new Error(`${name}: allowedDiscountPriceRate is required`);
  }
  if (sellSettings.discountPriceRate == null) {
    throw new Error(`${name}: discountPriceRate is required`);
  }
  if (sellSettings.maxSaleCount == null) {
    throw new Error(`${name}: maxSaleCount is required`);
  }
  if (sellSettings.targetAssetsCount == null) {
    throw new Error(`${name}: targetAssetsCount is required`);
  }
  if (sellSettings.maxPrice < 0) {
    throw new Error(`${name}: maxPrice must be positive`);
  }
  if (sellSettings.minPrice < 0) {
    throw new Error(`${name}: minPrice must be positive`);
  }
  if (sellSettings.allowedDiscountPriceRate < 0) {
    throw new Error(`${name}: allowedDiscountPriceRate must be positive`);
  }
  if (sellSettings.discountPriceRate < 0) {
    throw new Error(`${name}: discountPriceRate must be positive`);
  }
  if (sellSettings.maxSaleCount < 0) {
    throw new Error(`${name}: maxSaleCount must be positive`);
  }
  if (sellSettings.targetAssetsCount < 0) {
    throw new Error(`${name}: targetAssetsCount must be positive`);
  }
  if (sellSettings.maxPrice <= sellSettings.minPrice) {
    throw new Error(`${name}: maxPrice must be greater than minPrice`);
  }
  if (sellSettings.allowedDiscountPriceRate <= sellSettings.discountPriceRate) {
    throw new Error(`${name}: allowedDiscountPriceRate must be greater than discountPriceRate`);
  }
  if (_.round(sellSettings.maxPrice, 8) !== sellSettings.maxPrice) {
    throw new Error(`${name}: maxPrice must have no more than 8 digits after .`);
  }
  if (_.round(sellSettings.minPrice, 8) !== sellSettings.minPrice) {
    throw new Error(`${name}: minPrice must have no more than 8 digits after .`);
  }
  // check if reduce minPrice to fraction of discountPriceRate won't be the same as maxPrice
  if (_.round(sellSettings.minPrice - sellSettings.minPrice * sellSettings.discountPriceRate, 8) === sellSettings.maxPrice) {
    throw new Error(`${name}: minPrice must be greater than maxPrice - (maxPrice * discountPriceRate)`);
  }
  return true;
};
